import React from "react";
import heroImage from "../assets/hero.jpg";

function Home() {
  return (
    <div>
      <div className="hero" style={{ backgroundImage: `url(${heroImage})` }}></div>
      <div className="page-content">
        <h1>Welcome to Elegant Jewelry</h1>
        <p>Explore our exclusive collection of premium handcrafted jewelry.</p>
      </div>
    </div>
  );
}

export default Home;
